/* eslint-disable no-lone-blocks */
import { useState, useEffect } from "react";
import { Doughnut } from "react-chartjs-2";
import axios from "axios";

function ProgressList() {
  const [form, setForm] = useState([]);
  let pro = [];
  useEffect(() => {
    let use = [];

    axios.get("http://localhost:8080/progress/get").then((res) => {
      for (const dataObj of res.data) {
        pro.push(dataObj);
        console.log(pro);
      }
    });
  }, []);
  let data;

  {
    form.map(
      (f) =>
        (data = {
          labels: [f.userName],
          datasets: [
            {
              label: "# of Votes",
              data: [8, 5, 3, 5, 2, 3],
              backgroundColor: [
                "rgba(255, 99, 132, 0.2)",
                "rgba(54, 162, 235, 0.2)",
                "rgba(255, 206, 86, 0.2)",
                "rgba(75, 192, 192, 0.2)",
                "rgba(153, 102, 255, 0.2)",
                "rgba(255, 159, 64, 0.2)",
              ],
              borderColor: [
                "rgba(255, 99, 132, 1)",
                "rgba(54, 162, 235, 1)",
                "rgba(255, 206, 86, 1)",
                "rgba(75, 192, 192, 1)",
                "rgba(153, 102, 255, 1)",
                "rgba(255, 159, 64, 1)",
              ],
              borderWidth: 2,
            },
          ],
        })
    );
  }

  return (
    <div>
      <Doughnut data={data} style={{ width: "20px", height: "20px" }} />
    </div>
  );
}

export default ProgressList;
